"Atas persetujuan Anda, OnePlus akan mengumpulkan informasi penggunaan ponsel Anda untuk meningkatkan desain produk dan pengalaman pengguna. Jika Anda setuju untuk bergabung dengan Program Pengalaman Pengguna (\"Program\"), Anda setuju bahwa OnePlus dapat mengumpulkan, menggunakan, dan menganalisis informasi berikut:
  (1) Data konfigurasi;
  (2) Data statistik program aplikasi;
  (3) Data perilaku pengguna;
 Tujuan OnePlus mengumpulkan dan menganalisis data di atas adalah meningkatkan pengalaman pengguna. Semua semua prosedur dilakukan secara anonim dan terenkripsi untuk OnePlus, seperti melalui peningkatan efisiensi baterai dan stabilitas sistem. Data ini tidak akan digunakan untuk mengenali identitas pribadi apa pun. Setelah bergabung dengan Program, Anda dapat keluar kapan saja melalui metode berikut: Pengaturan - Lanjutan - Program Pengalaman Pengguna lalu hapus centang pada kotak. Silakan baca Kebijakan Privasi OnePlus untuk mempelajari lebih lanjut informasi yang diproses oleh OnePlus. Setelah Anda menarik diri dari Program, OnePlus akan berhenti mengumpulkan informasi Anda yang disebutkan di atas."
